import Header from "./Header";

export default function App() {
  con [counter, setCounter] = useState(0);

  function incremet() {
    setCounter(counter++);
  } 

  return (
    <>
      <Header>Counter: {counter}</Header>
      <button onClick={incremet}>Add</button>
    </>
  );
}
